import axios from 'axios'
export const FETCH_POSTS = "POSTS/FETCH_POSTS"



export const fetchData = () => {
    return (dispatch) => {
        return axios.get("http://localhost:5000/api/auth/books")
            .then(response => {
                return response.data
            })
            .then(data => {
                dispatch({
                    type: FETCH_POSTS,
                    payload: data
                })
            })
            .catch(error => {
                throw (error);
            });
    };
};
